import React from "react";
import { Grid, Paper } from "@material-ui/core";

function Login() {
  return (
    <div>
      {/* <Grid style={{ textAlign: "center" }} xs={6} justify="center">
        <Paper style={{ backgroundColor: "white" }}>BONJOURRR</Paper>
      </Grid> */}
      <Grid
        spacing={0}
        direction="column"
        alignItems="center"
        justify="center"
        style={{ minHeight: "100vh" }}
      >
        <Grid item xs={3}>
          <Paper style={{ backgroundColor: "white" }}>HELLLO</Paper>
        </Grid>
      </Grid>
    </div>
  );
}

export default Login;
